import React from "react";
import PostJobsComponent from "./components/postJobComponent";
import FindJobsComponent from "./components/findJobsComponent";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
       <Routes path="/">
          <Route path="/post" component={PostJobsComponent} />
          <Route path="/find-jobs" component={FindJobsComponent} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
